  const [blackCardVisible, setBlackCardVisible] = useState(false);
  const [purpleCardVisible, setPurpleCardVisible] = useState(false);

  useEffect(() => {
    const observer = new IntersectionObserver(
      (entries) => {
        entries.forEach((entry) => {
          if (entry.isIntersecting) {
            setBlackCardVisible(true);
            setTimeout(() => {
              setPurpleCardVisible(true);
            }, 400);
          }
        });
      },
      { threshold: 0.5 }
    );

    if (cardsRef.current) {
      observer.observe(cardsRef.current);
    }

    return () => {
      if (cardsRef.current) {
        observer.unobserve(cardsRef.current);
      }
    };
  }, []);

